import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import './header.css';

class NavBar extends Component {
    render() {
        return (
            <React.Fragment>
            <Router>
            <nav className="header">
                <h1 class="nav">Duke Club Badminton</h1>
                <nav className="nav">
                    <ul>
                        <li class="navAdd noSelect">Add</li>
                        <li class="noSelect">XD</li>
                        <li class="noSelect">WD</li>
                        <li class="noSelect">MD</li>
                        <li class="noSelect">WS</li>
                        <li class="noSelect">MS</li>
                    </ul>
                </nav>
            </nav>
            </Router>
            </React.Fragment>
        );
    }
}

export default NavBar;
